module.exports = "<!-- TESTIMONIALS CAROUSEL 3 -->\n<div id=\"researchquestions-link\" class=\"pt-110-b-80-cont pb-md-80 owl-plugin owl-1-pag-auto owl-carousel owl-bg-black owl-pag-2\"\n  style=\"background: #f3f3f3;\">\n\n<!-- owl-plugin owl-clients-auto owl-carousel fullwidth-slider owl-bg-black font-white\" -->\n\n  <!-- Slide Item -->\n  <div class=\"container\">\n    <div class=\"relative\">\n      <div class=\"row\">\n        <div class=\"col-md-12\">\n          <div class=\"ts3-author-cont\">\n            <img class=\"img-responsive\" src=\"images/thesis/ContributionsVisualInteractive.png\" alt=\"photo\">\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n\n  <!-- Slide Item -->\n  <div class=\"container\">\n    <div class=\"relative\">\n      <div class=\"row\">\n        <div class=\"col-md-12\">\n          <div class=\"ts3-author-cont\">\n            <img class=\"img-responsive\" src=\"images/thesis/ContributionsAutomatic.png\" alt=\"photo\">\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n\n  <!-- Slide Item -->\n  <div class=\"container\">\n    <div class=\"relative\">\n      <div class=\"row\">\n        <div class=\"col-md-12\">\n          <div class=\"ts3-author-cont\">\n            <img class=\"img-responsive\" src=\"images/thesis/ContributionsVA.png\" alt=\"photo\">\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n\n</div>\n\n<!-- Reserach questions CLIENTS 2 -->\n<div class=\"page-section p-80-cont bg-white\">\n  <div class=\"container\">\n\n    <h2 class=\"heading\">Research</h2>\n\n    <p class=\"text-left\">\n      <strong>Research Focus:</strong> In my research I focus on novel visual interactive techniques, algorithmic approaches\n      and integrated visual analytics systems to support users in navigating and exploring large amounts of relational data.\n      One central research objective is, amongst others, to automatically assess the interestingness of visualizations and\n      show only potentially important views from a large exploration space to reduce the users’ cognitive overload.\n    </p>\n\n    <p class=\"text-left\">\n      With my studies we want contribute to the matrix visualization research by enlarging the scope to data sets that have on\n      top of its large and dense characteristics, also multivariate and/or dynamic aspects. In case of multivariate data\n      one matrix can be constructed for every data type. In the case of dynamic datasets one matrix can be retrieved for\n      every time instance. In both cases, large amounts of matrices lead to both processing- and visualization challenges.\n    </p>\n\n    <p class=\"text-left\">\n      <strong>How can we support the exploration process for relational data with the help of\n                        matrix-based representations?</strong> How can enhance the expressiveness and effectiveness\n      of matrix visualizations? Which interaction concepts help the user in exploring relational data in matrix visualizations?\n    </p>\n\n    <p class=\"text-left\">\n      <strong>How can we describe and quantify the interestingness of matrices wrt. its contained\n                        patterns?</strong>\n      <span>How can we measure the occurrence of specific visual features (i.e., patterns) contained in matrices?\n          How can we derive interestingness scores depending on pattern descriptions for matrix-based representations?</span>\n    </p>\n    <p class=\"text-left\">\n      <strong>How can we help the user in navigating and exploring large matrix spaces?</strong> How can we compare matrices,\n      e.g., to allow for ’more-like-this’ queries? How can we support the user in defining queries for matrix patterns? How\n      can we train computer systems to reflect an analyst’s notion of interestingness?\n    </p>\n\n  </div>\n</div>"

